INSERT INTO `sentences` VALUES (1,'','to seek naught but vengeance','2015-10-06 22:21:50','2015-10-09 01:18:02',1,1),(2,'','to fear rousing the indignation and contempt of a proud witcher','2015-10-06 23:21:41','2015-10-07 12:46:10',1,2),(3,'','villages paid us levies','2015-10-06 23:55:00','2015-10-06 23:56:15',1,2),(4,'','witchers are an interesting caste','2015-10-07 00:00:42','2015-10-07 00:00:42',1,2),(5,'','the supposition that I mistake your trade for that of a hired thug has piqued me greatly','2015-10-07 00:05:02','2015-10-07 12:44:59',1,2),(6,'','the queen raised her hand and beckoned the castellan','2015-10-07 00:15:45','2015-10-07 12:44:40',1,2),(7,'','the witcher almost imperceptibly, nodded','2015-10-07 00:29:45','2015-10-07 12:45:17',1,2),(8,'','the youngest brother was paralytic','2015-10-07 00:38:40','2015-10-09 01:19:12',1,2),(9,'','the skald had emerged from the drinking unscathed','2015-10-07 13:41:33','2015-10-07 13:45:29',1,2),(10,'','the visor was covered with spikes like a conker casing','2015-10-07 13:44:54','2015-10-07 13:45:42',1,2),(11,'','speak from behind an iron trellis (a visor with a densly grated screen)','2015-10-07 13:59:44','2015-10-07 13:59:44',1,2),(12,'','he lay at the bottom of the gully and called for help','2015-10-07 14:05:35','2015-10-07 14:05:35',1,2),(13,'','the newcomer continued adamantly','2015-10-07 14:10:31','2015-10-07 14:10:31',1,2),(14,'','the king reached his retinue','2015-10-07 14:12:41','2015-10-07 14:12:41',1,2),(15,'','son of a trollop','2015-10-07 14:25:06','2015-10-07 14:25:06',1,2),(16,'','I will not give my daughter to this crank','2015-10-07 14:33:04','2015-10-07 14:33:04',1,2),(17,'','you do not dice with destiny with impunity','2015-10-07 14:41:36','2015-10-09 01:29:13',1,2),(18,'','it seems our late and lamented king was an oaf','2015-10-07 14:50:52','2015-10-10 13:44:49',1,2),(19,'','an indissoluble tie of destiny between the person demanding the oath and its object','2015-10-07 14:59:26','2015-10-07 14:59:26',1,2),(20,'','two bulbous button eyes looked out','2015-10-07 15:10:36','2015-10-07 15:10:36',1,2),(21,'','your own vassals have pointed out your haughty and contemptuous refusal','2015-10-07 15:17:16','2015-10-07 15:17:16',1,2),(22,'','the guards were armed with guisarmes and lances','2015-10-07 15:28:04','2015-10-07 15:28:04',1,2),(23,'','it is a pure primordial force','2015-10-07 15:41:15','2015-10-07 15:41:15',1,2),(24,'what has happened','what the deuce','2015-10-07 18:03:12','2015-10-07 18:03:12',1,2),(25,'','the better and the more conscientiously you witchers work, the less work there is for you','2015-10-07 18:44:57','2015-10-07 18:44:57',1,2),(26,'','he crossed the yard, avoiding the cowpats','2015-10-07 23:33:42','2015-10-07 23:33:42',1,2),(27,'','the witcher repeated his answer for the umpteenth time','2015-10-07 23:37:42','2015-10-07 23:37:42',1,2),(28,'','the bard chuckled impudently','2015-10-08 11:34:05','2015-10-08 18:42:30',1,2),(29,'','the witcher was looking at the peasant attentively, silently','2015-10-08 12:24:58','2015-10-08 12:24:58',1,2),(30,'','from the woodwork a sharp, resinous smell penetrated the room','2015-10-08 12:30:14','2015-10-08 12:30:14',1,2),(31,'','forsooth he does not bother us overly; there be times he even helps','2015-10-08 12:36:47','2015-10-10 13:40:03',1,2),(32,'','i did not ask you to traipse after me','2015-10-08 12:42:22','2015-10-08 12:42:22',1,2),(33,'','do not be scared, you will not get the mange by talking to me','2015-10-08 12:45:33','2015-10-08 12:45:33',1,2),(34,'','the peasants attacked the devil with stanchions and pitchforks','2015-10-08 12:52:21','2015-10-08 12:52:21',1,2),(35,'','your devil is a sylvan','2015-10-08 17:45:34','2015-10-08 17:45:34',1,2),(36,'','the witcher surreptitiously slipped a hand into his pocket','2015-10-08 17:53:45','2015-10-08 17:53:45',1,2),(37,'','the witcher had heard of incomprehensible decrees before','2015-10-08 17:56:12','2015-10-09 01:35:49',1,2),(38,'','the slaughter of entire pedigree herds','2015-10-08 17:57:51','2015-10-08 17:57:51',1,2),(39,'','the cessation of sowing or harvesting','2015-10-08 18:00:18','2015-10-08 18:00:18',1,2),(40,'','the sylvan bleated and kicked','2015-10-08 18:06:48','2015-10-08 18:06:48',1,2),(41,'','the baby was crying with a fretful whimper','2015-10-08 23:07:57','2015-10-08 23:07:57',1,2),(42,'','the vertebrae in his neck cracked','2015-10-08 23:13:22','2015-10-08 23:13:22',1,2),(43,'','a sonorous voice suddenly commanded','2015-10-08 23:21:03','2015-10-08 23:21:03',1,2),(44,'','the tall elf in the jacket adorned with colourful feathers','2015-10-08 23:24:19','2015-10-08 23:24:19',1,2),(45,'','they knelt by the prostrate woman','2015-10-08 23:36:17','2015-10-09 01:34:14',1,2),(46,'','the elf rider was sitting in a sumptuous saddle','2015-10-08 23:39:46','2015-10-08 23:39:46',1,2),(47,'','the elves need to learn to domesticate game or poultry','2015-10-08 23:47:07','2015-10-08 23:47:07',1,2),(48,'','the elves are exiled and hounded to the edge of the world','2015-10-08 23:52:48','2015-10-08 23:52:48',1,2),(49,'','acknowledging one\'s sovereignty','2015-10-08 23:57:41','2015-10-08 23:57:41',1,2),(50,'','i am suprised you want to arouse a feeling of guilt and repentance in such a louse as me','2015-10-09 00:05:21','2015-10-09 00:05:21',1,2),(51,'','do not grovel. do not beg him','2015-10-09 00:10:01','2015-10-09 00:10:01',1,2),(52,'','for someone who has lived such a short time, you show an astounding disdain for death, human','2015-10-09 00:14:11','2015-10-09 00:14:11',1,2),(53,'','the greater longevity of elves compared to humans','2015-10-09 00:16:59','2015-10-09 00:20:46',1,2),(54,'','her longevity in office now appeared as a handicap to the party','2015-10-09 00:19:47','2015-10-09 00:19:47',1,3),(55,'','your mother gives birth to you only once and only once do you die, the poet said haughtily','2015-10-09 00:25:56','2015-10-09 00:25:56',1,2),(56,'','verily, i do not know who to side with','2015-10-09 00:30:42','2015-10-09 00:30:42',1,2),(57,'','my queen, the elf said with veneration and then bowed and knelt','2015-10-09 00:36:48','2015-10-09 00:36:48',1,2),(58,'','the plants grew out of enormous chests, troughs and flowerpots','2015-10-09 10:57:54','2015-10-09 10:57:54',1,2),(59,'','i am not thinking of appeasing or bribing her','2015-10-09 11:22:32','2015-10-09 11:22:32',1,2),(60,'','appease the baby with a pacifier','2015-10-09 11:23:57','2015-10-09 11:23:57',1,3),(61,'','her ovaries are atrophied and it is irreversible','2015-10-09 11:26:30','2015-10-09 11:26:30',1,2),(62,'','the imagination can atrophy from lack of use','2015-10-09 11:32:44','2015-10-09 11:32:44',1,3),(63,'','the catfish stuck its barbelled head above the surface','2015-10-09 11:54:51','2015-10-09 11:54:51',1,2),(64,'','the fish line hissed as the witcher\'s gloves smouldered','2015-10-10 00:32:46','2015-10-10 00:32:46',1,2),(65,'','the echo resounded through the osiers','2015-10-10 00:57:37','2015-10-10 00:57:37',1,2),(66,'','he extended his hand toward the assailant','2015-10-10 01:21:52','2015-10-10 01:21:52',1,2),(67,'','the police have no firm leads about the identity of his assailant','2015-10-10 01:23:58','2015-10-10 01:23:58',1,3),(68,'','students had to traipse all over london to attend lectures','2015-10-10 11:06:04','2015-10-10 11:06:04',1,3),(69,'','he was a conscientious man, he took his duties very seriously','2015-10-10 11:49:35','2015-10-10 11:49:35',1,3),(70,'','low wages were supplemented by surreptitious payments from tradesmen','2015-10-10 11:51:46','2015-10-10 11:51:46',1,3),(71,'','each person who turns to God in genuine repentance and faith will be saved','2015-10-10 13:43:38','2015-10-10 13:43:38',1,3),(72,'','the beetle exudes a caustic liquid','2015-10-11 14:24:40','2015-10-11 14:24:40',1,3),(73,'','orders are orders. i will go to the pillory if i let you through','2015-10-13 02:01:08','2015-10-13 02:01:08',1,2),(74,'','take your friend down from his horse and put him in the room in the barbican','2015-10-13 02:08:30','2015-10-13 02:08:30',1,2),(75,'','ever since the king placed an exorbitant tax on spells, magicans have boycotted the capital','2015-10-13 02:11:04','2015-10-13 02:11:04',1,2),(76,'','she ostentatiously makes light of the councilors, holds balls and extravagant parties','2015-10-13 02:14:51','2015-10-13 02:14:51',1,2),(77,'','the councilors are furious and tarnish her reputation as best they can','2015-10-13 02:18:01','2015-10-13 02:18:01',1,2),(78,'','the witcher reached out and touched the tarnished ring','2015-10-13 02:46:43','2015-10-13 02:46:43',1,2),(79,'','then go, you loiterer, to the whorehouse to satisfy your need','2015-10-13 02:56:28','2015-10-13 02:56:28',1,2),(80,'','he was looking at the abundant black locks visible from under the eiderdown','2015-10-13 03:19:27','2015-10-13 03:19:27',1,2),(81,'','she had a shapely neck and, around it, a black velvet choker with a starshaped jewel','2015-10-13 03:24:35','2015-10-13 03:24:35',1,2),(82,'','i disturbed your sleep and peace, discourteously and importunately','2015-10-13 03:28:08','2015-10-13 03:28:08',1,2),(83,'','pure-blooded elves were not wont to admire human women','2015-10-13 03:38:51','2015-10-13 03:38:51',1,2),(84,'','he was wont to arise at 5.30 every morning','2015-10-13 03:41:19','2015-10-13 03:41:19',1,3),(85,'','who would condemn their daughters to years of tedious studies and the tortures of somatic mutations','2015-10-13 03:43:39','2015-10-13 03:44:12',1,2),(86,'','the magic hidden within them was palpable','2015-10-13 03:47:42','2015-10-13 03:47:42',1,2),(87,'','he knew the magic was dormant - it brought to mind the purr of a sleeping lion, without suggesting how the roar might sound','2015-10-13 03:50:12','2015-10-13 03:50:12',1,2),(88,'','she contorted her lips in a smile','2015-10-13 03:53:00','2015-10-13 03:53:00',1,2),(89,'','all of them, to a man, rushed to the window','2015-10-13 03:55:51','2015-10-13 03:55:51',1